import { AppBar, Toolbar, Typography } from '@mui/material';

const Header = () => (
    <AppBar position="static" sx={{ marginBottom: 2 }}>
        <Toolbar>
            <Typography variant="h6">CRUD Application</Typography>
            
        </Toolbar>
    </AppBar>
);

export default Header;
